    //         currentTasks: this.props.userTasks
    //     }
    // }


    render() {

        return(
            <React.Fragment>
                {
                    this.props.userTasks.map(task => 
                        <TaskCard key={task.id} task={task} onEditTask={this.props.onEditTask}/>
                    )
                }
            </React.Fragment>

        );
    }




}

export default TaskList;
